Check out the full line of Bambu Lab Machines: https://tidd.ly/3Mye3xG

You can find the 3D Models from this challenge here: 
https://makerworld.com/en/@engineezy

Have a project in mind? Submit it to the Let’s Make It Fund:
https://bambulab.com/letsmakeitfund

I hosted a 24 Hour Hackathon at the Engineezy HQ where 3 teams of makers competed to build robots capable of destroying highly fortified gingerbread 'houses'.  I could not believe what went down with less than a day of work. 

Check out all the amazing makers that competed in this challenge:
@MorleyKert  - Incredible Builds that Use 3D Printing and Carpentry
@ForgeCoreCo - Aesthetic and Functional 3D Printable Models
@LoftedGoods - Incredibly well designed 3D Printable Lamps and Planters
@Ruven_Bals - Really Clever 3D Printable Mechanisms and Fidgets
@dannylumcreative - Insanely Engineered Mechatronic Contraptions
@RyderCalmDown - Projects at the intersection of Art and Engineering
@concept_bytes - Some seriously OP Mechatronic
